51,259' href='http://www.gwer.nl' shape='rect' target='_blank'> <area alt='dejavu-events' coords='448,121,537,193' href='http://www.dejavu-events.nl/' shape='rect' target='_blank'> <area alt='Primera' coords='248,134,423,177' href='http://www.primera.nl' shape='rect' target='_blank'> <area alt='paylogic' coords='41,133,221,178' href='http://www.paylogic.nl' shape='rect' target='_blank'> <area alt='nh hotels' coords='315,36,383,102' href='http://www.nh-hotels.nl' shape='rect' target='_blank'> <area alt='Bavaria' coords='33,34,297,103' href='http://www.bavaria.nl' shape='rect' target='_blank'> <\/map>",Iwb='<null message>',sEb='<object width="640" height="385"><param name="movie" value="http://www.youtube.com/v/uIt7LqnKn9c&hl=en_US&fs=1&rel=0&color1=0x006699&color2=0x54abd6"><\/param><param name="allowFullScreen" value="true"><\/param><param name="allowscriptaccess" value="always"><\/param><embed src="http://www.youtube.com/v/FGfr_StxajE&hl=en_US&fs=1&rel=0&color1=0x006699&color2=0x54abd6&autoplay=1" type="application/x-shockwave-flash" allowscriptaccess="always" allowfullscreen="true" width="640" height="385"><\/embed><\/object>',EEb='<p class="sub">Thanx...<\/p><p class="tittle">',aFb="<p class='tittle'>Dj's Salvationz.<\/p> <p>Salvationz heeft met een \u2018Earth\u2019 en \u2018Heaven\u2019 stage twee areas met verschillende stijlen die op 12 juni van 11.00-23.00 uur het domein worden van vele bekende top dj\u2019s.<\/p> <ul type='DISC'> <b> <li>Ferry Corsten<\/li> <li>Franco Baresi (Zino's)<\/li> <li>Roog<\/li> <li>Real el Canario<\/li> <li>Vato Gonzalez<\/li> <li>La Fuente<\/li> <li>Marco V<\/li> <li>Marcel Woods<\/li> <li>Jochen Miller<\/li> <li>Quintino<\/li> <li>Marco Joosten<\/li> <li>Nouveaubeats<\/li> <li>Rockz<\/li> <\/b> <\/ul> <p>Houd deze site in de gaten voor het laatste nieuws wat betreft de Line up van Salvationz!<\/p> <p>Volg ons voor het laatste nieuws via Twitter! <\/p>",DFb="<p class='tittle'>Locatie<\/p> <p> De locatie van Salvationz, het E3 Strand, is gelegen in Eersel. <\/p> <p> Een ideale locatie in Noord-Brabant voor een dance festival! <\/p> <p> Het E3 Strand is omgeven door helder water en een mooi zandstrand met een afgeschermde, bosrijke omgeving als decor. Vanaf de snelweg ben je in nog geen 5 minuten in een compleet andere omgeving. Het E3 Strand is uitstekend bereikbaar per auto, taxi, openbaar vervoer en fiets. Met 4000 parkeerplaatsen is er ruime parkeergelegenheid voor bezoekers. <\/p> <p> Houd de site in de gaten voor het laatste nieuws over de mogelijkheden! <\/p> <span id='",LFb="<p class='tittle'>Party at the lake, Sleep in the forest...<\/p> <p class='sub'> Sluit Salvationz af met een heerlijke overnachting in NH Koningshof. <\/p> <p> Word wakker in een door bossen omgeven hotel en geniet van een uitgebreid ontbijtbuffet. Na een verfrissende duik in het zwembad is het weekend zeker geslaagd. <\/p> <p> <span id='",CFb="<p class='tittle'>Routeschrijving E3 Strand, Buivensedreef in Eersel<\/p> <img src='/salvationz/img/e3Map.png'> <p class='sub'> Vanuit Eindhoven/Veldhoven/Venlo/Duitsland: <\/p> <p> Volg de autosnelweg A67, richting Turnhout. Neem afslag 32, dan rechtsaf borden E3-strand volgen. Rechtsaf bij carpoolplaats en de bochtige weg volgen tot ingang E3-strand. Rechtsaf door witte poort de weg volgen naar parking. <\/p> <p class='sub'> Vanuit Turnhout/Antwerpen: <\/p> <p> Volg de autosnelweg A67 noord-oostwaarts, richting Eindhoven. Neem afslag 32, dan linksaf borden E3-strand volgen. (vervolg zie boven) <\/p> <p class='sub'> Vanuit Valkenswaard: <\/p> <p> Provincialeweg N612 volgen richting Dommelen, Eersel. Bij rotonde Het Stuivertje voorbij Eersel rechtdoor weg volgen. (vervolg zie boven) <\/p> <p class='sub'> Vanuit Maastricht: <\/p> <p> Autosnelweg A2 noordwaarts richting Eindhoven. Bij verkeersplein Leenderheide linksaf.... (vervolg zie boven) <\/p> <p class='sub'> Vanuit Tilburg: <\/p> <p> Na autosnelweg A58 bij Batadorp de A2 gaan volgen zuidwaarts. Afslag richting Eersel/Turnhout nemen (vervolg zie boven &gt;) <\/p> <p class='sub'> Vanuit Den Bosch/Best: <\/p> <p> Autosnelweg A2 zuidwaarts richting Eindhoven. Bij Ekkersweijer rechts aanhouden A58 volgen richting Tilburg. Direct bij eerste afslag A58 verlaten bij Batadorp en A2 gaan volgen zuidwaarts. Afslag richting Eersel/Turnhout nemen.... (vervolg zie boven&gt;) <\/p> <span id='",KFb="<p class='tittle'>Salvationz slaat op 12 juni 2010 haar vleugels uit op het E3 Strand in Eersel.<\/p> <p class='sub'>Van 11:00 uur tot 23:00 uur zal er House, Eclectic, Club, Progressive &amp; Trance uit de speakers knallen.<\/p> <p>Het wordt een uitgepakte eerste editie van Salvationz met een gevarieerde en zeer aansprekende Line up!!<\/p> <p>Bij Salvationz staat de totaalbeleving centraal, dus naast een lekkere sound en optimale food &amp; beverage voorzieningen, mogen uitdagende dansshows en verrassende theater acts op het terrein natuurlijk niet ontbreken. Salvationz is een euforische trip van het moment dat je binnen komt tot je weer voldaan naar huis gaat. <\/p> <p class='sub'>\u201CEnjoy earth like heaven\u201D<\/p> <p>De Early bird tickets \xE1 \u20AC 25,- (ex. Fee) zijn vanaf nu verkrijgbaar op www.salvationz.nl en bij alle Primera verkooppunten. De Early birds zijn verkrijgbaar tot 16 april 2010, dus ben er snel bij! Reguliere tickets kosten \u20AC 32,50 (ex. Fee) <\/p> <p>Pendeldiensten zijn mogelijk vanaf station Eindhoven. Een hotelovernachting in het Koningshof te Veldhoven is tevens mogelijk, check de button \u201CLocation\u201D voor meer informatie. Houd deze site in de gaten voor de vele mogelijkheden en het laatste nieuws over Salvationz!! <\/p>",REb='<p class=tittle>Organisatie<\/p><p><a href="http://www.guaranteevents.nl" target="_blank"><img src="/salvationz/img/ge.jpg" href="http://www.guaranteevents.nl"><br>Guaranteevents<\/a><br><a href=mailto:info@salvationz.nl>mail@guaranteevents.nl<\/a><\/p><p class=tittle>E-tickets<\/p><p>Voor alle vragen over e-ticket...<br><a href=mailto:e-tickets@salvationz.nl>e-tickets@salvationz.nl<\/a><\/p><p class=tittle>Marketing en communicatie<\/p><p>Voor alle promotionele activiteiten...<br><a href=mailto:M&C@salvationz.nl>M&C@salvationz.nl<\/a><\/p>',xFb="<span id='",OAb='=',XHb='=(?!=)',UHb='==',Bwb='=============\n',ywb='============= gwt-log-',xwb='@',ozb='A',Ayb='A request timeout has expired after ',nGb='ABOUT',Hxb='ABSOLUTE',Yyb='AD',Ryb='AM',Exb='AUTO',XEb='About<hr>',WKb='AbsolutePanel',ZKb='AbstractCollection',yPb='AbstractHashMap',APb='AbstractHashMap$EntrySet',BPb='AbstractHashMap$EntrySetIterator',DPb='AbstractHashMap$MapEntryNull',EPb='AbstractHashMap$MapEntryString',$Kb='AbstractList',FPb='AbstractList$IteratorImpl',pIb='AbstractLogger',xPb='AbstractMap',GPb='AbstractMap$1',HPb='AbstractMap$1$1',CPb='AbstractMapEntry',IPb='AbstractSequentialList',iLb='AbstractSerializationStream',jLb='AbstractSerializationStreamReader',kLb='AbstractSerializationStreamWriter',zPb='AbstractSet',vQb='ActionException',yGb='Add not supported on this collection',CGb='Add not supported on this list',SOb='AddToFreeTickets',TOb='AddToNewsLetter',QGb='All',dyb='An event type',OLb='Anchor',QIb='Animation',TIb='Animation$1',SIb='Animation;',Vyb='Anno Domini',dPb='AnnotationTypeMismatchException',Fzb='Apr',bzb='April',ePb='ArithmeticException',gPb='ArrayIndexOutOfBoundsException',vMb='ArrayList',hPb='ArrayStoreException',JPb='Arrays$ArrayList',QLb='AttachDetachException',RLb='AttachDetachException$1',SLb='AttachDetachException$2',Izb='Aug',fzb='August',Xyb='BC',sAb='BEGIN',yxb='BLOCK',JBb='BOOLEAN',fCb='BUTTON',KBb='BYTE',YHb="Bad parameter: Parameters require a single '=' between the key and value.",yMb='BaseListenerWrapper',nNb='BasicPresenter',CQb='BasicPresenter$1',Uyb='Before Christ',iKb='BeforeSelectionEvent',zCb='Bottom',EIb='Button',DIb='ButtonBase',UEb='Buy your tickets at paylogic...',WFb='Buy your tickets...',iDb='CENTER',LBb='CHAR',Qxb='CM',jGb='CONTACT',rxb='CSS1Compat',GGb="Can't get element ",bxb="Can't ove
